    /**
     * No radical status recorded.
     */
    NONE(0),

    /**
     * Singlet.
     */
    SINGLET(1),

    /**
     * Doublet.
     */
    DOUBLET(2),

    /**
     * Triplet.
     */
    TRIPLET(3);


    /**
     * Internal InChI index (from inchi_api.h).
     */
    private final int indx;

    /**
     * Constructor.
     * @param indx  index of radical.
     */
    private INCHI_RADICAL(final int indx) {
        this.indx = indx;
    }

   /**
    * Returns index.
    * @return
    */
    public int getIndx() {
        return indx;
    }

    public static INCHI_RADICAL getValue(int rad) {
        switch (rad) {
            case 0:
                return NONE;
            case 1:
                return SINGLET;
            case 2:
                return DOUBLET;
            case 3:
                return TRIPLET;
            default:
                return null;
        }
    }
    
}

