        this.indx = indx;
    }

    public int getIndx() {
        return indx;
    }


    public static INCHI_PARITY getValue(int parity) {
        switch (parity) {
            case 0:
                return NONE;
            case 1:
                return ODD;
            case 2:
                return EVEN;
            case 3:
                return UNKNOWN;
            case 4:
                return UNDEFINED;
            default:
                return null;
        }
    }
